INSERT INTO `oro_email_template` VALUES (1,1,1,1,'force_reset_password',NULL,'Please reset your password','<style>\n    @media (max-width: 480pt) {\n        .wrapper{\n            width: 100% !important;\n        }\n    }\n    a:hover {\n        text-decoration: underline;\n    }\n</style>\n<table class=\"wrapper\" style=\"border-collapse: collapse; width: 640px; width: 480pt; max-width: 100%; box-sizing: border-box\">\n    <tr>\n        <td style=\"background-color: #ffffff; padding: 4pt\">\n            <span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 14pt; line-height: 14pt; color: #444444\">Hi, {{ entity|oro_format_name }}!</span>\n            <div style=\"height: 10pt; line-height: 10pt\">&nbsp;</div>\n            <p style=\"color: #444444; font-size: 10pt; font-family: Arial, Helvetica, sans-serif; font-weight: normal; margin: 5pt 0 5pt 0;\">\n                The administrator has requested a password reset for your user profile. Please use the Reset Password button below to visit a secure page where you can reset your password.\n            </p>\n            <p style=\"color: #444444; font-size: 10pt; font-family: Arial, Helvetica, sans-serif; font-weight: normal; margin: 5pt 0 10pt 0;\">\n                Please note that your old password is no longer valid and you wont be able to use it to access the application.\n            </p>\n            <table style=\"width: 100%;\">\n                <tbody>\n                <tr>\n                    <td>&nbsp;</td>\n                    <td style=\"padding: 5pt 0; background: #2ea63a; width: 130pt; text-align: center\">\n                        <a style=\"color: #ffffff; font-size: 11pt; text-transform: uppercase; text-decoration: none; line-height: 1em; font-family: Arial, Helvetica, sans-serif;\" href=\"{{ oro_get_absolute_url(\'oro_user_reset_reset\', { token: entity.confirmationToken }) }}\" target=\"_blank\">\n                            RESET&nbsp;PASSWORD\n                        </a>\n                    </td>\n                    <td>&nbsp;</td>\n                </tr>\n                </tbody>\n            </table>\n        </td>\n    </tr>\n</table>','Oro\\Bundle\\UserBundle\\Entity\\User','html',1,1,'Tjs='),(2,1,1,1,'user_impersonate',NULL,'Impersonation','<style>\n    @media (max-width: 480pt) {\n        .wrapper{\n            width: 100% !important;\n        }\n    }\n    a:hover {\n        text-decoration: underline;\n    }\n</style>\n<table class=\"wrapper\" style=\"border-collapse: collapse; width: 480pt; max-width: 100%; box-sizing: border-box\">\n    <tr>\n        <td style=\"background-color: #ffffff; padding: 4pt\">\n            <span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 14pt; line-height: 14pt; color: #444444\">Hi, {{ entity|oro_format_name }},</span>\n            <div style=\"height: 10pt; line-height: 10pt\">&nbsp;</div>\n            <p style=\"color: #444444; font-size: 10pt; font-family: Arial, Helvetica, sans-serif; font-weight: normal; margin: 5pt 0 5pt 0;\">\n                You have been impersonated. This means another user has accessed the system under your profile&mdash;most likely they are troubleshooting an issue you have reported. However, if it isnt the case, please contact your system administrator immediately.\n            </p>\n        </td>\n    </tr>\n</table>','Oro\\Bundle\\UserBundle\\Entity\\User','html',1,1,'Tjs='),(3,1,1,1,'user_change_password',NULL,'A new password was assigned to you','<style>\n    @media (max-width: 480pt) {\n        .wrapper{\n            width: 100% !important;\n        }\n    }\n    a:hover {\n        text-decoration: underline;\n    }\n</style>\n<table class=\"wrapper\" style=\"border-collapse: collapse; width: 640px; width: 480pt; max-width: 100%; box-sizing: border-box\">\n    <tr>\n        <td style=\"background-color: #ffffff; padding: 4pt\">\n            <span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 14pt; line-height: 14pt; color: #444444\">Hello, {{ entity|oro_format_name }}!</span>\n            <div style=\"height: 10pt; line-height: 10pt\">&nbsp;</div>\n            <p style=\"color: #444444; font-size: 10pt; font-family: Arial, Helvetica, sans-serif; font-weight: normal; margin: 5pt 0 10pt 0;\">\n                Your password was successfully reset.\n            </p>\n            <table style=\"width: 100%\">\n                <tbody>\n                <tr>\n                    <td>&nbsp;</td>\n                    <td style=\"padding: 5pt 0; background: #2ea63a; width: 180pt; text-align: center\">\n                        <a style=\"color: #ffffff; font-size: 11pt; text-transform: uppercase; text-decoration: none; line-height: 1em; font-family: Arial, Helvetica, sans-serif;\" href=\"{{ oro_get_absolute_url(\'oro_default\') }}\" target=\"_blank\">\n                            LOGIN&nbsp;AND&nbsp;START&nbsp;TO&nbsp;WORK\n                        </a>\n                    </td>\n                    <td>&nbsp;</td>\n                </tr>\n                </tbody>\n            </table>\n        </td>\n    </tr>\n</table>','Oro\\Bundle\\UserBundle\\Entity\\User','html',1,1,'Tjs='),(4,1,1,1,'user_reset_password_as_admin',NULL,'Please reset your password','<style>\n    @media (max-width: 480pt) {\n        .wrapper{\n            width: 100% !important;\n        }\n    }\n    a:hover {\n        text-decoration: underline;\n    }\n</style>\n<table class=\"wrapper\" style=\"border-collapse: collapse; width: 640px; width: 480pt; max-width: 100%; box-sizing: border-box\">\n    <tr>\n        <td style=\"background-color: #ffffff; padding: 4pt\">\n            <span style=\"font-family: Arial, Helvetica, sans-serif; font-size: 14pt; line-height: 14pt; color: #444444\">Hello, {{ entity|oro_format_name }}!</span>\n            <div style=\"height: 10pt; line-height: 10pt\">&nbsp;</div>\n            <p style=\"color: #444444; font-size: 10pt; font-family: Arial, Helvetica, sans-serif; font-weight: normal; margin: 5pt 0 5pt 0;\">\n                This email was sent to you by administrator.\n            </p>\n            <p style=\"color: #444444; font-size: 10pt; font-family: Arial, Helvetica, sans-serif; font-weight: normal; margin: 5pt 0 10pt 0;\">\n                Administrator have requested to reset the password for your user account. If you want to reset your password,\n                please click \"Reset Password\" button and it takes you to a secure page where you can do it.\n            </p>\n            <table style=\"width: 100%;\">\n                <tbody>\n                <tr>\n                    <td>&nbsp;</td>\n                    <td style=\"padding: 5pt 0; background: #2ea63a; width: 130pt; text-align: center\">\n                        <a style=\"color: #ffffff; font-size: 11pt; text-transform: uppercase; text-decoration: none; line-height: 1em; font-family: Arial, Helvetica, sans-serif;\" href=\"{{ oro_get_absolute_url(\'oro_user_reset_reset\', { token: entity.confirmationToken }) }}\" target=\"_blank\">\n                            RESET&nbsp;PASSWORD\n                        </a>\n                    </td>\n                    <td>&nbsp;</td>\n                </tr>\n                </tbody>\n            </table>\n            <p style=\"color: #888; font-size: 8pt; font-family: Arial, Helvetica, sans-serif; font-weight: normal; margin: 10pt 0 5pt 0;\">\n                Please note that the button link above is only valid for 24 hours. If you don\'t want to reset your password,\n                please ignore this message. Your password will not be reset.\n            </p>\n        </td>\n    </tr>\n</table>','Oro\\Bundle\\UserBundle\\Entity\\User','html',1,1,'Tjs='),(5,1,1,1,'user_reset_password',NULL,'Reset password','<style>\n    @media (max-width: 480pt) {\n        .wrapper{\n            width: 100% !important;\n        }\n    }\n    a:hover {\n        text-decoration: underline;\n    }\n</style>\n<table class=\"wrapper\" style=\"border-collapse: collapse; wi